#include <stdint.h>

#include "../inc/tm4c123gh6pm.h"
#include "../inc/DAC.h"
#include "Timer0.h"

const uint8_t *SongLoc;
uint16_t SongSize;
uint16_t idxSong = 0;

// ***************** Timer0_Init ****************
// Activate TIMER0 interrupts to run user task periodically
// Inputs:  period in units (1/clockfreq)
//          priority is 0 (high) to 7 (low)
// Outputs: none
void Timer0_Init(uint32_t period, uint32_t priority){
  volatile int delay;
  SYSCTL_RCGCTIMER_R |= 0x01;   // 0) activate TIMER0
  delay = SYSCTL_RCGCTIMER_R;
  TIMER0_CTL_R = 0x00000000;    // 1) disable TIMER0A during setup
  TIMER0_CFG_R = 0x00000000;    // 2) configure for 32-bit mode
  TIMER0_TAMR_R = 0x00000002;   // 3) configure for periodic mode, default down-count settings
  TIMER0_TAILR_R = period-1;    // 4) reload value
  TIMER0_TAPR_R = 0;            // 5) bus clock resolution
  TIMER0_ICR_R = 0x00000001;    // 6) clear TIMER0A timeout flag
  TIMER0_IMR_R = 0x00000001;    // 7) arm timeout interrupt
  NVIC_PRI4_R = (NVIC_PRI4_R&0x00FFFFFF)|(priority<<29); // priority is bits 31,30,29
// interrupts enabled in the main program after all devices initialized
// vector number 35, interrupt number 19
  NVIC_EN0_R = 1<<19;           // 9) enable IRQ 19 in NVIC
  TIMER0_CTL_R = 0x00000001;    // 10) enable TIMER0A
}

void Timer0A_Start(void){
  NVIC_EN0_R = 1<<19;           // 9) enable IRQ 19 in NVIC
}

void Song_Stop(void){
  NVIC_DIS0_R = 1<<19;    // 9) disable IRQ 19 in NVIC
}

void Song_Init(void){
   // initialize a 11.025kHz Timer0A, and the DAC
  Timer0_Init(80000000/11025, 2);
  Song_Stop();    // 9) disable IRQ 19 NVIC
	DAC_Init();
}

void Timer0A_Handler(void){
  TIMER0_ICR_R = TIMER_ICR_TATOCINT;// acknowledge TIMER0A timeout
  // output one value to DAC if a sound is active
	// write this
	DAC_Out(*(SongLoc+idxSong)); // DAC input is Table Value
	if (idxSong < SongSize){ // Ensures sound stops when index exceeds wave size
		idxSong++;
	} else {
		idxSong = 0;
	}
	
}

//******* Song_Start ************
// This function does not output to the DAC. 
// Rather, it sets a pointer and counter, and then enables the timer interrupt.
// It starts the sound, and the timer ISR does the output
// feel free to change the parameters
// Input: pt is a pointer to an array of DAC outputs
//        count is the length of the array
// Output: none
// special cases: as you wish to implement
void Song_Start(const uint8_t *pt, uint32_t count){
	// write this
	SongLoc = pt;
	SongSize = count;
	Timer0A_Start();
};


// start playing Jungle Music
void Song_Jungle(void){
	Song_Start(jungle, junglesize);
};

// start playing Battle Music
void Song_Battle(void){
	Song_Start(battle, battlesize);
};

